    "900205": {
        "v0": {
            "Name": "Talent",
            "MaxLevel": 1,
            "Desc": "When allies protected by Aventurine Shield (excluding Aventurine) perform a follow-up attack, Aventurine gains 1 Coin.<br>When allies protected by Aventurine Shield suffer from an attack, Aventurine gains 1 Coin. If the character has an A card, Aventurine will gain extra Coins.<br>When Aventurine has 6 Coins, he will consume 6 coins to perform the follow-up attack \"Coin Attack\": Deal multiple instances of Imaginary DMG to random targets, with a chance to lower the target's Effect Hit Rate. Then, all allies under Aventurine Shield will discard their card and pull a new one."
        }
    },
    "900207": {
        "v0": {
            "Name": "Technique",
            "MaxLevel": 1,
            "Desc": "Aventurine rolls a dice, with three results: 1, 2, 3. If Aventurine does not obtain a 3 after a certain number of rolls, the next roll is guaranteed to give a 3.<br>After entering combat, Aventurine's DEF is increased based on the result of the dice, with 3 giving the most DEF.<br>After entering battle, will also apply Aventurine Shield to all allies and let all allies pull a card."
        }
    },
