    "900304": {
        "v0": {
            "Name": "Ultimate",
            "MaxLevel": 1,
            "Desc": "Consumes all Energy Points, and enters the Ultra Pose, performing the following actions within 1 turn. During Ultra Pose, all enemies' All-Type RES is decreased.<br><br>· Deals Thunder DMG to all targets, and triggers <color style='color:#f29e38'>Lotus Bloom</color> on every single target that has Lotus.<br>· Acts again, dealing Thunder DMG to all targets, and triggers <color style='color:#f29e38'>Lotus Bloom</color> on every single target that has Lotus.<br>· Acts again, dealing Thunder DMG to all targets, and triggers <color style='color:#f29e38'>Lotus Bloom</color> on every single target that has Lotus.<br>· Acts again, dealing Thunder DMG to all targets. In the end, remove all Lotus from enemies and exits Ultra Pose."
        }
    },
    "900305": {
        "v0": {
            "Name": "Talent",
            "MaxLevel": 1,
            "Desc": "<color style='color:#f29e38'><b>Energy Point</b></color><br>Acheron initially has 0 Energy Points. When Acheron has enough Enegry Points, the Ultimate will be available. For every Energy Point gained, Acheron will apply 1 Lotus to a her target. If Acheron does not have a target, the target holding the highest number of Lotus will be selected, prioritizing Elite enemies.<br><br>When any enemy is inflicted with a debuff, Acheron gains 1 Energy Point. This can be triggered once every turn.<br>When an enemy is defeated or escapes, their Lotus will be transferred to other targets.<br><br><color style='color:#f29e38'><b>Lotus Bloom</b></color><br>Consumes the Lotus held by a single target, with an upper limit of 3 per target.<br>Deals Thunder DMG to all targets. This DMG counts as Ultimate DMG. For every Lotus consumed, this DMG is increased by 100%, independent from other buffs."
        }
    },
